import React from 'react';
import { Link } from 'react-router-dom'; // Import the Link component

const Home = () => {
    return (
        <div>
            <main className="hero">
                <div className="hero-content">
                    <div className="hero-text">
                        <h2>Building modern, scalable web applications</h2>
                        <p>Welcome! I'm Mohamed Ali, a developer passionate about creating clean and efficient code. Explore my work and skills below.</p>
                        <Link to="/projects" className="btn-primary">View My Work</Link> {/* Example button/link to Projects */}
                    </div>
                    <div className="hero-image">
                        <img src="/Images/chen-Qtu3hGinLF8-unsplash.jpg" alt="Coding at Work" />
                    </div>
                </div>
            </main>
            <div className="links">
                <Link to="/about">About</Link> {/* Link to the About page */}
                <Link to="/techstack">Tech Stack</Link> {/* Link to the Tech Stack page */}
                <Link to="/projects">Projects</Link> {/* Additional link to Projects if needed elsewhere */}
            </div>
        </div>
    );
};

export default Home;
